   s1 := "abcabcbb"
   fmt.Print("Case1: ", (3==lengthOfLongestSubstring(s1)), "\n")
   s2 := "bbbbb"
   fmt.Print("Case2: ", (1==lengthOfLongestSubstring(s2)), "\n")
   s3 := "pwwkew"
   fmt.Print("Case3: ", (3==lengthOfLongestSubstring(s3)), "\n")
   s4 := ""
   fmt.Print("Case4: ", (0==lengthOfLongestSubstring(s4)), "\n")
   s5 := "a"
